#  RGB 
def convert_to_hex(cleaned_data):
    hex_data = b''  # 
    
    for r, g, b, char in cleaned_data:
        #  RGB 
        hex_data += struct.pack('BBB', r, g, b)  # RGB ()
        # ASCII 
        hex_data += struct.pack('B', ord(char))  # 
    
    return hex_data

#  test.cimg 
def write_cimg_file(hex_data, output_file="test.cimg"):
    with open(output_file, "wb") as f:
        # 
        f.write(b'\x63\x49\x4D\x47')  #  cIMG
        
        #  0x02 
        f.write(struct.pack("<H", 0x03))  #  0x03
        
        #  dimensions
        dimensions = 0x184C
        f.write(struct.pack("<H", dimensions))  #  0x184C

        f.write(b'\x01\x00\x00\x00')
        f.write(b'\x01\x00')

        
        #  cleaned_info.txt 
        f.write(hex_data)  # 

